<?php

namespace Tests\Feature;

use App\Code\V1\Emails\Services\Senders\Jobs\ProcessEmailsJob;
use App\Code\V1\Emails\Services\Senders\Mails\SendEmail;
use App\Models\Email;
use App\Models\EmailAttachment;
use App\Models\User;
use Illuminate\Foundation\Testing\RefreshDatabase;
use Illuminate\Foundation\Testing\WithFaker;
use Illuminate\Support\Facades\Mail;
use Illuminate\Support\Facades\Queue;
use Tests\TestCase;

class EmailControllerTest extends TestCase
{
    use RefreshDatabase;

    public function test_send_email_without_any_parameters()
    {
        $user = User::factory()->create();

        $response = $this->actingAs($user)
            ->post('api/v1/email/send');

        $response->assertStatus(200);
    }

    public function test_send_email_with_missing_email()
    {
        $user = User::factory()->create();

        $response = $this->actingAs($user)
            ->postJson('api/v1/email/send', [
                [
                    'subject' => 'Subj',
                    'body' => 'something big',
                    'attachments' => []
                ]
            ]);

        $response->assertStatus(422);
    }

    public function test_send_email_with_missing_subject()
    {
        $user = User::factory()->create();

        $response = $this->actingAs($user)
            ->postJson('api/v1/email/send', [
                [
                    'email' => 'x@x.com',
                    'body' => 'something big',
                    'attachments' => []
                ]
            ]);

        $response->assertStatus(422);
    }

    public function test_send_email_with_missing_body()
    {
        $user = User::factory()->create();

        $response = $this->actingAs($user)
            ->postJson('api/v1/email/send', [
                [
                    'email' => 'x@x.com',
                    'subject' => 'Subj',
                    'attachments' => []
                ]
            ]);

        $response->assertStatus(422);
    }

    public function test_send_email_with_missing_attachments()
    {
        $user = User::factory()->create();

        $response = $this->actingAs($user)
            ->postJson('api/v1/email/send', [
                [
                    'email' => 'x@x.com',
                    'subject' => 'Subj',
                    'body' => 'something big',
                ]
            ]);

        $response->assertStatus(422);
    }

    public function test_send_email_happy_path()
    {
        Queue::fake();
        $user = User::factory()->create();

        $response = $this->actingAs($user)
            ->postJson('api/v1/email/send', [
                [
                    'email' => 'x@x.com',
                    'subject' => 'Subj',
                    'body' => 'something big',
                    'attachments' => [
                        [
                            'value' => 'data:image/jpeg;base64,',
                            'name' => 'My Pic'
                        ]
                    ]
                ]
            ]);

        Queue::assertPushed(ProcessEmailsJob::class);

        $response->assertStatus(200);
    }

    public function test_list_emails()
    {
        $user = User::factory()->create();

        Email::factory()
            ->has(EmailAttachment::factory()->count(2), 'attachments')
            ->count(1)
            ->create();

        $response = $this
            ->actingAs($user)
            ->getJson('/api/v1/email/list');

        $response->assertSuccessful();
        $response->assertJsonStructure([
            [
                'id',
                'email',
                'subject',
                'body',
                'created_at',
                'updated_at',
                'attachments' => [
                    [
                        'id',
                        'email_id',
                        'attachment',
                        'name',
                        'created_at',
                        'updated_at'
                    ],
                    [
                        'id',
                        'email_id',
                        'attachment',
                        'name',
                        'created_at',
                        'updated_at'
                    ],
                ]
            ]
        ]);

    }
}
